import "./App.css";
import "bootstrap/dist/css/bootstrap.min.css";
import MyCard from "./mycomponent/Mycard";
import { Container, Row } from "react-bootstrap";
function App() {
  return (
    <>
      <div className="App"></div>
      <Container>
        <Row className="d-flex">
          <MyCard />
          <MyCard />
          <MyCard />
        </Row>
      </Container>
    </>
  );
}

export default App;
